<div class="pt-20 px-4" data-theme="light">
    <div class="flex flex-col-reverse text-center my-8">
        <div>
            <h1 class="text-3xl font-bold text-primary-600 dark:text-primary-200">
                {{ __("Marketing d'influence") }}
            </h1>
            <p class="max-w-screen-sm mx-auto text-center font-medium text-gray-700 dark:text-gray-300">
                {{
                __(
                "Les consommateurs suivent des influenceurs pour leurs recommandations"
