                                        {{
                                        __(
                                        "68% des personnes connectées interagissent avec un influenceur au moins une
                                        fois par jour."
                                        )
                                        }}
                                    </p>
                                </div>
                            </div>
                        </li>
                        <li data-content="★" class="step">
                            <div class="flex space-x-3 pt-5">
                                <div>
                                    <div class="radial-progress bg-primary-600 text-primary-content border-4 border-primary-600"
                                        style="--value: 65">
                                        65%
                                    </div>
                                </div>
                                <div class="text-left">
                                    <h3 class="text-primary-600 font-medium uppercase">
                                        {{ __("Des professionnels") }}
                                    </h3>
                                    <p>
                                        {{
                                        __(
                                        "65% des professionnels préfèrent exécuter une stratégie d'influence basée sur
                                        des campagnes."
                                        )
                                        }}
                                    </p>
                                </div>
                            </div>
                        </li>
                        <li data-content="★" class="step">
