                                    <div class="radial-progress bg-primary-600 text-primary-content border-4 border-primary-600"
                                        style="--value: 46">
                                        46%
                                    </div>
                                </div>
                                <div class="text-left">
                                    <h3 class="text-primary-600 font-medium uppercase">
                                        {{ __("Des consommateurs") }}
                                    </h3>
                                    <p>
                                        {{
                                        __(
                                        "46% des consommateurs suivent des influenceurs pour leurs recommendations."
                                        )
                                        }}
                                    </p>
                                </div>
                            </div>
                        </li>
                    </ul>
                </div>
                <p class="italic font-medium">
                    {{
                    __(
                    "Une personne capable d'influencer le comportement de consommation dans un univers donné =
                    Influenceur"
                    )
                    }}
                </p>
            </div>
