<script src="https://code.jquery.com/jquery-3.6.0.min.js"
    integrity="sha256-/xUj+3OJU5yExlq6GSYGSHk7tPXikynS7ogEvDej/m4=" crossorigin="anonymous"></script>
<script type="text/javascript">
    $(document).ready(function() {
  $(document).scroll(function() {
    // calculate half the viewport
    var compensation = $(window).height() / 2;
    // calculate where the sections start
    var home = ($('.home').offset().top) - compensation;
    var splash = ($('.splash').offset().top) - compensation;
    var laiche = ($('.laiche').offset().top) - compensation;
    var saleBooster = ($('.sale-booster').offset().top) - compensation;
    var taupeDataSeller = ($('.taupe-data-seller').offset().top) - compensation;
    var theMold = ($('.the-mold').offset().top) - compensation;
    var takeover = ($('.takeover').offset().top) - compensation;
    var groupTirGroup = ($('.group-tir-group').offset().top) - compensation;
    var leVenin = ($('.le-venin').offset().top) - compensation;
    var theBite = ($('.the-bite').offset().top) - compensation;
    var footer = ($('footer').offset().top) - compensation;
    var scrollPos = $(document).scrollTop();


    // Apply text changes
    if (scrollPos >= splash && scrollPos < laiche) {
      $('.displayer').toggleClass('lg:hidden');
    }
    else if (scrollPos >= laiche && scrollPos < saleBooster) {
      $('.displayer').toggleClass('lg:hidden');
    }
    else if (scrollPos >= saleBooster && scrollPos < taupeDataSeller) {
      $('.displayer').toggleClass('lg:hidden');
    }
    else if (scrollPos >= theMold && scrollPos < takeOver) {
      $('.displayer').toggleClass('lg:hidden');
    }
    else if (scrollPos >= groupTirGroup && scrollPos < leVenin) {
      $('.displayer').text('Work');
    }
    else if (scrollPos >= theBite && scrollPos < footer) {
      $('.displayer').text('Contact');
    }
    else {
      $('.displayer').text('');
    }
  }); // close scroll function
}); // close document ready
</script>
